import './App.css';
import axios from 'axios'

function App() {

  const fetchData = async () => {
    let data = await axios.get("http://www.omdbapi.com/?s=star wars&apikey=af883339")
    console.log(data.data.Search)
  }

  fetchData()

  return (
    <div className="App">
      hello
    </div>
  );
}

export default App;
